import React from 'react'
import './App.css'
import Particles from 'react-tsparticles'
import Navbar from './components/Navbar.js'
import Header from './components/Header'
import 'bootstrap/dist/css/bootstrap.min.css'

function App() {
  return (
    <div>
      <Particles
        params={{
          particles: {
            number: {
              value: 30,
              density: {
                enable: true,
                value_area: 900
              }
            }
          }
        }}
      />
      <Navbar />
      <Header />
    </div>
  )
}

export default App;
